import React, { Component } from 'react'
import { makeStyles } from "@material-ui/core/styles";
import { CardMedia } from '@material-ui/core';
import '../components/Carrusel/Carrusel.css'

const s = {
    container: "screenW screenH dGray col ",
    header: "flex1 fCenter fSize2",
    main: "flex8 white",
    footer: "flex1 fCenter",
    image: "fullW fullH imgCover"
};
  
export class ConsultaVirtual extends Component {
    componentDidMount(){
        document.getElementById("loader").style.display = "none";
    }
    componentDidUpdate(){
        document.getElementById("loader").style.display = "initial";
    }
    render() {
        return (
            <div>
                <CardMedia image="https://www.help.cl/wp-content/themes/help_template/assets/img/teleconsulta/banner-consulta-medica-virtual-1366x300.jpg" ></CardMedia>
            </div>
        )
    }
}

export default ConsultaVirtual
